/** @format */

import React from "react";
import { Accordion, Button } from "react-bootstrap";

const AccordionQuse = ({data}) => {
  return (
    <Accordion>
        {
            data.lingth <= 1 ? (data.map((e)=>{
                return (
                    <Accordion.Item eventKey="1">
        <Accordion.Header>
          <div className="m-auto">{e.q}</div>
        </Accordion.Header>
        <Accordion.Body>
          <div className="d-flex justify-content-between">
          <div className="">{e.a}</div>
          <Button className="btn btn-primary">مسح السوال</Button>
          </div>
        </Accordion.Body>
      </Accordion.Item>
                )
            })) : <h2 className="text-center border text-danger">لا يوجد اسئلة</h2>
        }
      
    </Accordion>
  );
};

export default AccordionQuse;
